import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="text-center max-w-xl mx-auto">
      <h2 className="text-3xl font-bold mb-4">Contact Me</h2>
      <p className="text-gray-700 mb-4">Feel free to reach out via email or social links below.</p>
      <a href="mailto:pankaj@example.com" className="text-green-600 hover:underline">pankaj@example.com</a>
    </section>
  );
};

export default Contact;
